// UpdateEvent.js
import React, { useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { useAppContext } from "../Store/store";

export function UpdateEvent() {
  const location = useLocation();
  const navigate = useNavigate();
  const { eventDispatch } = useAppContext();

  // Get the event object passed from Settings page
  const event = location.state?.event;

  // Local state for editing
  const [name, setName] = useState(event?.name || "");
  const [phone, setPhone] = useState(event?.phone || "");
  const [eventId, setEventId] = useState(event?.eventId || "");
  const [date, setDate] = useState(event?.date || "");
  const [locationName, setLocationName] = useState(event?.location || "");

  // Handle event update
  const handleUpdate = async () => {
    try {
      // Build updated event object
      const updatedEvent = {
        ...event,
        name,
        phone,
        eventId,
        date,
        location: locationName,
      };

      // Update backend
      const res = await fetch(`http://localhost:3001/events/${event._id}`, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(updatedEvent),
      });

      const data = await res.json();

      if (res.ok) {
        // Update Redux-like store
        eventDispatch({
          type: "events/updateEvent/fulfilled",
          payload: data.event, // updated event from backend
        });

        alert("Event updated successfully!");
        navigate("/settings"); // go back to settings page
      } else {
        alert(data.error || "Failed to update event");
      }
    } catch (err) {
      console.error(err);
      alert("Server error. Please try again.");
    }
  };

  return (
    <div className="update-event-page">
      <h2>Update Event</h2>
      <div className="update-form">
        <label>
          Event Name:
          <input value={name} onChange={(e) => setName(e.target.value)} />
        </label>
        <label>
          Phone:
          <input value={phone} onChange={(e) => setPhone(e.target.value)} />
        </label>
        <label>
          Event ID:
          <input value={eventId} onChange={(e) => setEventId(e.target.value)} />
        </label>
        <label>
          Date:
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
          />
        </label>
        <label>
          Location:
          <input
            value={locationName}
            onChange={(e) => setLocationName(e.target.value)}
          />
        </label>
        <button onClick={handleUpdate}>Save Changes</button>
        <button onClick={() => navigate("/settings")}>Cancel</button>
      </div>
    </div>
  );
}
